package net.heartsome.cat.te.core.bean;/** * 键值对的形式，其中键可以重复。 * @author robert	2013-07-19 */public class Property {	private String key;	private String value;		public Property(){ }		public Property(String key, String value){		this.key = key;		this.value = value;	}	public String getKey() {		return key;	}	public void setKey(String key) {		this.key = key;	}	public String getValue() {		return value;	}	public void setValue(String value) {		this.value = value;	}				}